import unittest, os, importlib


class CloudWatchLogs_Firehose_Resources_Tests(unittest.TestCase):

	def setUp(self):
		# Set environment variables
		os.environ['SPLUNK_SOURCE'] = "841154226728"
		os.environ['SPLUNK_SOURCETYPE'] = "aws:cloudwatchlogs"
		os.environ['SPLUNK_HOST'] = "841154226728"
		os.environ['SPLUNK_INDEX'] = "aws"
		os.environ['PRESERVE_DOUBLE_BACKSLASHES_IN_EVENT'] = "false"

		# import lambda module to test
		self.lambda_module = importlib.import_module('lambda')


	def test_one(self):

		testInput = {'invocationId': 'becd65b6-252a-4e66-bbb1-1001c091abc3', 'deliveryStreamArn': 'arn:aws:firehose:us-west-2:841154226728:deliverystream/841154226728-us-west-2-lambdacloudtrail-firehose', 'region': 'us-west-2', 'records': [{'recordId': '49636824083378936888143884586489700312348099680449593346000000', 'approximateArrivalTimestamp': 1673385843089, 'data': ''}, {'recordId': '49636824083378936888143884602226287706271729640464711682000000', 'approximateArrivalTimestamp': 1673385872981, 'data': ''}]}

		expectedOutput = {'records': [{'recordId': '49636824083378936888143884586489700312348099680449593346000000', 'result': 'Ok', 'data': ''}, {'recordId': '49636824083378936888143884602226287706271729640464711682000000', 'result': 'Ok', 'data': ''}]}

		self.assertEqual(self.lambda_module.handler(testInput, "none"), expectedOutput)


