		expectedOutput = {'records': [{'recordId': '49636824083378936888143884676531704283065306992770809858000000', 'result': 'Ok', 'data': ''}, {'recordId': '49636824083378936888143884689912095254560024072808300546000000', 'result': 'Ok', 'data': ''}]}

		self.assertEqual(self.lambda_module.handler(testInput, "none"), expectedOutput)


